import React, {Component} from 'react';
import './Content.css';

class Content extends Component{
    render(){
        return(
            <div>
                <div className="Content">

                    <p className="title" >The Good Fork</p>
                    <p className="address">West Toronto | 1550 Dundas St W, Toronto, ON M6K 1T5</p>
                    <tr>
                        <td>Location: 30 minute commute from downtown core</td>
                        <td>Food for Value: approx. $15 for large portions + fresh food</td>
                    </tr>
                    <tr>
                        <td></td>
                        <td></td>
                    </tr>
                </div>
            </div>
        );

    }
}

export default Content
